import React, { Component } from 'react';
import './App.css';

class SignIn extends Component {
    render(){
        return(
            <div className="mw6 center bg-white br3 pa3 pa4-ns mv3 ba b--black-10 bg-light-blue">
                        <h1 className="tc coolFont">Sign in</h1>
                        <div className="mt3">
                            <label htmlFor="username" className="db f6 ph2 mb2">Username</label>
                            <input type="text" name="username" className="input-reset db w-100 mw-100 white b pv2 ph3 bg-white-30 hover-bg-lightest-blue hover-gray outline-0 bn br-pill"/>
                        </div>
                        <div className="mv3">
                            <label htmlFor="password" className="db f6 ph2 mb2" >Password</label>
                            <input type="password" name="password"
                                   className="input-reset db w-100 mw-100 white b pv2 ph3 bg-white-30 hover-bg-lightest-blue hover-gray outline-0 bn br-pill"/>
                        </div>

                    <p className="tc input-reset db w-100 f6 b ttu tracked pv3 ph3 pointer bg-light-blue hover-bg-lightest-blue bn br-pill">Sign In</p>
                        <div className="lh-copy mt3">
                            <p className="f6 black db">Don't have an account yet?<a href="signUp" className="black link"> Sign up</a></p>

                        </div>

            </div>
        );
    }
}

export default SignIn;
